import java.io.*;
import java.util.*;

public class Main {
    static final int N = 405;
    static final int M = 100005;
    static int n, m;
    static int[] x = new int[M], y = new int[M];
    static int[][] f = new int[N][N];
    static int[][] g = new int[N][N];
    static int[][] h = new int[N][N];
    static int[][] dp = new int[N][N];
    static int[][] sum = new int[N][N];

    public static void main(String[] args) throws IOException {
        Scanner sc = new Scanner(System.in);
        PrintWriter pw = new PrintWriter(System.out);
        n = sc.nextInt();
        m = sc.nextInt();
        for (int i = 1; i <= m; i++) {
            x[i] = sc.nextInt();
            y[i] = sc.nextInt();
            if (x[i] > y[i]) {
                int temp = x[i];
                x[i] = y[i];
                y[i] = temp;
            }
        }
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= n; j++) {
                f[i][j] = g[i][j] = h[i][j] = sum[i][j] = dp[i][j] = 0;
            }
        }
        for (int i = 1; i <= n; i++) {
            f[i][i] = 1;
        }
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                for (int k = 1; k <= n; k++) {
                    g[j][k] += f[j][k];
                    if (j != k) {
                        g[j][k] += f[j][k - 1];
                    }
                }
            }
            for (int j = 1; j <= n; j++) {
                for (int k = 1; k <= n; k++) {
                    h[j][k] += g[j][k];
                    if (j != k) {
                        h[j][k] += g[j][k - 1];
                    }
                }
            }
            for (int j = 1; j <= n; j++) {
                for (int k = 1; k <= n; k++) {
                    sum[j][k] += h[j][k];
                    if (j != k) {
                        sum[j][k] += h[j][k - 1];
                    }
                }
            }
            for (int j = 1; j <= n; j++) {
                for (int k = 1; k <= n; k++) {
                    dp[j][k] += sum[j][k];
                    if (j != k) {
                        dp[j][k] += sum[j][k - 1];
                    }
                }
            }
            for (int j = 1; j <= n; j++) {
                for (int k = 1; k <= n; k++) {
                    if (j != k) {
                        f[j][k] += dp[j][k];
                    }
                }
            }
        }
        long ans = 0;
        for (int i = 1; i <= n; i++) {
            for (int j = i + 1; j <= n; j++) {
                if (f[i][j] > 0) {
                    ans++;
                }
            }
        }
        pw.println(ans);
        pw.close();
    }

    static class Scanner {
        BufferedReader br;
        StringTokenizer st;

        Scanner(InputStream in) {
            br = new BufferedReader(new InputStreamReader(in));
        }

        String next() throws IOException {
            while (st == null || !st.hasMoreTokens()) {
                st = new StringTokenizer(br.readLine());
            }
            return st.nextToken();
        }

        int nextInt() throws IOException {
            return Integer.parseInt(next());
        }
    }
}
